impl Solution {
    pub fn min_operations(nums: Vec<i32>, target: i32) -> i32 {
        use std::collections::HashMap;

        let mut power_count = HashMap::new();
        for &num in &nums {
            *power_count.entry(num).or_insert(0) += 1;
        }

        let mut target = target;
        let mut operations = 0;

        for power in (0..=30).rev() {
            let value = 1 << power;
            while target >= value && power_count.get(&value).unwrap_or(&0) > &0 {
                target -= value;
                *power_count.entry(value).or_insert(0) -= 1;
                if value > 1 {
                    *power_count.entry(value / 2).or_insert(0) += 2;
                    operations += 1;
                }
            }
        }

        if target == 0 { operations } else { -1 }
    }
}
